private void readObject(ObjectInputStream s) throws ClassNotFoundException, IOException {
    s.defaultReadObject();
    FigureEnumeration k = figures();
    while (k.hasMoreElements()) {
        Figure figure = k.nextFigure();
        figure.addToContainer(this);
    }
}
